ERROR=0
sudo tar xzf newtron-radio-v3.2.tgz -C /usr/local/lib/
if [ $? -ne 0 ]; then
  ERROR=1
fi
sudo cp newtron-radio /usr/local/bin
sudo chmod a+rx /usr/local/bin/newtron-radio
for i in mpd mpc python3-rpi.gpio python3-pip cython3 python3-pygame libts-bin; do
  dpkg -s $i >/dev/null 2>&1
  if [ $? -eq 0 ]; then
    echo "$i ist bereits installiert!"
  else
    sudo apt-get -y -q --no-install-recommends install $i
    if [ $? -ne 0 ]; then
	ERROR=1
    fi
  fi
done

if [ ! -w /var/lib/mpd/playlists -a -d /var/lib/mpd/playlists ]; then
  sudo chgrp audio /var/lib/mpd/playlists
  sudo chmod g+rwxs /var/lib/mpd/playlists
fi
if [ ! -w /var/lib/mpd/music -a -d /var/lib/mpd/music ]; then
  sudo chgrp audio /var/lib/mpd/music
  sudo chmod g+rwxs /var/lib/mpd/music
fi

sudo python3 -m pip install pynanosvg
dpkg -s python3-mpd >/dev/null 2>&1
if [ $? -eq 0 ]; then
  sudo apt-get -y -q purge python3-mpd
  if [ $? -ne 0 ]; then
    ERROR=1
  fi
fi
sudo python3 -m pip install python-mpd2

if [ $version = "9" ]; then # stretch
  sudo apt-get -y -q install libdirectfb-1.2-9
  if [ $? -ne 0 ]; then
    ERROR=1
  fi
  sudo dpkg -i libsdl1.2debian_1.2.15-5_armhf.deb
  if [ $? -ne 0 ]; then
    ERROR=1
  fi
  sudo apt-mark hold libsdl1.2debian
  if [ $? -ne 0 ]; then
    ERROR=1
  fi
fi

if [ $version = "10" ]; then # buster
  sudo dpkg -i libsdl1.2debian_1.2.15+veloci1-1_armhf.deb
  if [ $? -ne 0 ]; then
    ERROR=1
  fi
fi

if [ -d /etc/systemd/system ]; then
  sudo cp -f newtron-radio.service /etc/systemd/system 2>/dev/null
  sudo systemctl daemon-reload
fi

if [ -d /usr/share/icons/hicolor ]; then
  sudo cp -f newtronradio-48.png /usr/share/icons/hicolor/48x48/apps/newtronradio.png 2>/dev/null
  sudo cp -f newtronradio-32.png /usr/share/icons/hicolor/32x32/apps/newtronradio.png 2>/dev/null
  sudo cp -f newtronradio-16.png /usr/share/icons/hicolor/16x16/apps/newtronradio.png 2>/dev/null
  sudo cp -f newtronradio.svg /usr/share/icons/hicolor/scalable/apps/ 2>/dev/null
fi

if [ -d /usr/share/applications ]; then
  sudo cp -f newtronradio.desktop /usr/share/applications/
fi
if [ -d /usr/share/pixmaps ]; then
  sudo cp -f newtronradio.xpm /usr/share/pixmaps/
fi

if [ $ERROR -ne 0 ]; then
  echo "======================================"
  echo " Das Skript wurde mit Fehler beendet!"
  echo "======================================"
  echo "Bitte korrigieren sie diese und/oder"
  echo "fÃ¼hren Sie das Skript erneut aus."
else
  echo "Fertig!"
fi

